import {useSelector} from 'react-redux';

function Album(){

    // 获取store中的数据
    const {isLogin} = useSelector(state => ({
        isLogin:state.loginState.isLogin
    }));


    return (
        <Wrapper>
            <DayRecommendContent className='content' style={{display:isLogin?'block':"none"}}>

            </DayRecommendContent>
        </Wrapper>
    );
}

export default Album;
